import React, { Component } from 'react';
import axios from 'axios';



export class allEmp extends Component {
    constructor(props) {
        super(props);

        this.fetchUserClicked = this.fetchUserClicked(this);

        this.state = {
            username: '',
            password: '',
            errors: {}
        }
    }

    fetchUserClicked(e) {
           axios.post("https://reqres.in/api/users?delay=3").then(result => {
            if (result.status === 200) {
                localStorage.setItem('currentUser', JSON.stringify(result.data));
                console.log("Data Fetched");

            } else {
                this.props.history.push("/");
                console.log("Data Fetching Fail");
            }
            console.log(result);
        })
    }

    render() {
        return (
            <div className="container-login100-form-btn">
                <button
                    className="login100-form-btn"
                    id="adminButton"
                    onClick={this.fetchUserClicked}
                    disabled={!this.validateForm()}
                >Admin</button>
            </div>
        );
    }
}
